import React from 'react';
import '../App.css';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import Homepage from './Homepage';
import Navigation from './Navigation';

function App() {
  return (
    <Router>

    <div className="App">
      <header className="App-header">
        <Navigation />
      </header>
    </div>
    </Router>

  );
}

export default App;
